import React from 'react';
import OrderComponent from '../components/OrderComponent';
import { PageHeader } from 'antd';

const OrderContainer = () => {
  return (
    <>
      <PageHeader
        ghost={false}
        title={`Carrito`}
      />
      <OrderComponent />
    </>
  )
};

export default OrderContainer;
